// Tests the behaviour as well as a workaround for a strict encoding limitation
// in relation to serializing raw transactions. This was reported in
// https://github.com/farcaster-project/farcaster-node/issues/788
#[test]
fn strict_encode_test() {
    use hex;
    use strict_encoding::StrictEncode;

    let tx = "";

    let vec_tx = hex::decode(tx).unwrap();
    assert!(vec_tx.len() > 65535);
    let val = vec![];
    assert!(vec_tx.strict_encode(val).is_err());
    let chunks: Vec<Vec<u8>> = vec_tx.chunks(65534).map(|c| c.to_vec()).collect();
    for chunk in chunks.iter() {
        let val = vec![];
        chunk.strict_encode(val).unwrap();
    }
    let mut val = vec![];
    chunks.strict_encode(&mut val).unwrap();
    assert!(val.len() > 65535);
}
